    num = INST_lConnectalMemoryInitializationInput.dump_VCD_defs(l);
    num = INST_lConnectalProcIndicationOutput.dump_VCD_defs(l);
    num = INST_lConnectalProcRequestInput.dump_VCD_defs(l);
    num = INST_lConnectalWrapper_m.dump_VCD_defs(l);
